summary:
Op dit moment van 2023 tot en met 2025 trainee Fysiek Domein @BMC.
Gepassioneerd afgestudeerde in Landschapsarchitectuur en Landschapsgeschiedenis, met een tweedegraads docentbevoegdheid in Aardrijkskunde. 

Wat voedt mijn werkethos?
❝Landschappelijke innovatie en ruimtelijke vooruitgang boeken door middel van aandacht te geven aan het verleden en de geest van de plek❞

}BSc Landchapsarchitectuur en Ruimtelijke Kwaliteit (WUR)
}MA Landschapsgeschiedenis (RUG)
}Historische Kartografie (UvA)
}Minor Educatie, Tweedegraads bevoegdheid Aardrijkskunde
}Greek and Roman Mythology (University of Pennsylvania)

|| Landschap als onderlegger voor nieuwe ontwikkelingen. Het ontstaan, uiterlijk en functioneren implementeren en utiliseren in duurzame gebiedsontwikkeling, met oog voor de waarde van het (cultuur-)landschap.
|| Mijn hart gaat sneller kloppen van bijzondere Nederlandse en buitenlandse landschappen, cartografie, voedsel, (culturele) historie en de klassieke oudheid.
|| Ik werk graag structureel, planmatig en gefocust, en heb goed gevoel voor 'the grand scheme'.
|| Ik beschik over een goede set sociale vaardigheden, en geef ik het liefst alles en iedereen aandacht en zorg. Ik maak snel nieuwe contacten en vind het fijn om deze zo goed mogelijk te onderhouden.
